import React from 'react';
import Navbar from './components/Navbar';
import Mapbox from './components/Mapbox';

function App() {

  return (
    <div className="App">
      <header className="App-header">
        <Navbar></Navbar>
        <h1>Climbing Point</h1>
        <Mapbox></Mapbox>

        <h1>Temp Db</h1> 
      </header>
    </div>
  );
}

export default App;
